# Train Polynomial Regression
poly_reg = LinearRegression()
poly_reg.fit(X_train_poly, y_train)

# Predict for plotting
X_fit = np.linspace(X_scaled.min(), X_scaled.max(), 100).reshape(-1,1)
X_fit_poly = poly.transform(X_fit)
